import React, { Component } from 'react';
import PropTypes from 'prop-types';

export default class MainDisp extends Component{
    constructor(props){
        super(props)
        this.state = {
            emailList:[]
        }
    }


    render(){
        return(<div>
            {this.state.emailList}

        </div>)
    }

}

MainDisp.PropTypes = {
Truth : PropTypes.bool,

}
